module.exports = {
  root: true,
  env: {
    browser: true,
    commonjs: true,
    node: true,
  },
  parser: "@typescript-eslint/parser",
  parserOptions: {
    tsconfigRootDir: __dirname,
    project: ["./tsconfig.json", "./website/tsconfig.json"],
  },
  globals: {
    JSX: true,
  },
  extends: [
    "eslint:recommended",
    "plugin:react/recommended",
    "plugin:react-hooks/recommended",
    "plugin:@typescript-eslint/recommended",
    "plugin:import/recommended",
    "plugin:regexp/recommended",
    "plugin:prettier/recommended",
  ],
  settings: {
    "import/resolver": {
      node: {
        extensions: [".js", ".jsx", ".ts", ".tsx"],
      },
      typescript: true,
    },
    react: {
      version: "detect",
    },
  },
  overrides: [
    {
      files: ["*.ts", "*.tsx"],
      rules: {
        "import/no-unresolved": "off",
      },
    },
    {
      files: ["*.js", "*.cjs"],
      rules: {
        "@typescript-eslint/no-var-requires": "off",
      },
    },
  ],
  plugins: ["@typescript-eslint"],
  rules: {
    "linebreak-style": ["error", "unix"],
    quotes: ["error", "double", { avoidEscape: true }],
    semi: ["error", "always"],
    "@typescript-eslint/no-non-null-assertion": "off",
    "import/order": [
      "error",
      {
        groups: [
          "builtin",
          "external",
          "internal",
          "parent",
          "sibling",
          "index",
        ],
        pathGroups: [
          { pattern: "react", group: "builtin", position: "before" },
          { pattern: "fs-extra", group: "builtin" },
          { pattern: "lodash", group: "external", position: "before" },
          { pattern: "clsx", group: "external", position: "before" },
          { pattern: "@theme/**", group: "internal" },
          { pattern: "@site/**", group: "internal" },
          { pattern: "@theme-init/**", group: "internal" },
          { pattern: "@theme-original/**", group: "internal" },
        ],
        pathGroupsExcludedImportTypes: [],
        "newlines-between": "always",
        alphabetize: {
          order: "asc",
        },
      },
    ],
  },
};

{
  "tabWidth": 2,
  "useTabs": false,
  "endOfLine": "lf",
  "arrowParens": "always",
  "singleQuote": false,
  "trailingComma": "es5",
  "semi": true,
  "overrides": [
    {
      "files": [
        "**/devcontainer.json",
        "**/tsconfig.json",
        "**/tsconfig.*.json"
      ],
      "options": {
        "parser": "json"
      }
    }
  ]
}

module.exports = {
  extends: ["stylelint-config-standard", "stylelint-prettier/recommended"],
  overrides: [
    {
      files: ["*.css"],
      rules: {
        "function-no-unknown": [true, { ignoreFunctions: ["theme"] }],
        "selector-class-pattern": [
          "^([a-z][a-z0-9]*)(-[a-z0-9]+)*$",
          {
            resolveNestedSelectors: true,
            message: (selector) =>
              `Expected class selector "${selector}" to be kebab-case`,
          },
        ],
      },
    },
    {
      files: ["*.module.css"],
      rules: {
        "selector-class-pattern": [
          "^[a-z][a-zA-Z0-9]+$",
          {
            message: (selector) =>
              `Expected class selector "${selector}" to be lowerCamelCase`,
          },
        ],
      },
    },
  ],
};

{
  "compilerOptions": {
    "target": "ES2020",
    "lib": ["ESNext"],
    "module": "NodeNext",
    "declaration": true,
    "declarationMap": false,
    "sourceMap": false,
    "jsx": "react-native",
    "noEmit": true,

    /* Strict Type-Checking Options */
    "strict": true,
    "strictNullChecks": true,
    "strictFunctionTypes": true,
    "strictBindCallApply": true,
    "strictPropertyInitialization": true,
    "noImplicitThis": true,
    "alwaysStrict": true,

    /* Additional Checks */
    // "noUnusedLocals": false, // ensured by eslint, should not block compilation
    // "noImplicitReturns": true,
    // "noFallthroughCasesInSwitch": true,

    /* Disabled on purpose (handled by ESLint, should not block compilation) */
    "noUnusedParameters": false,

    /* Module Resolution Options */
    "moduleResolution": "nodenext",
    "allowSyntheticDefaultImports": true,
    "esModuleInterop": true,
    "isolatedModules": true,

    /* Advanced Options */
    "resolveJsonModule": true,
    "skipLibCheck": true, // @types/webpack and webpack/types.d.ts are not the same thing

    /* Use tslib */
    "importHelpers": true,
    "noEmitHelpers": true
  },
  "include": ["./**/.eslintrc.js", "./**/.stylelintrc.js"],
  "exclude": ["node_modules", "**/lib/**/*"]
}
